import React, {Component} from 'react'

class MainComponentTime extends Component
{
    render(){
        return(
            <div>
                <div class="center">חלון שעונים</div>
                <br/>
                <div style={{borderStyle: "solid",  width: "auto", margin:"auto"}}>+250:03:17:07</div>



            </div>
        )
    }
}

export default MainComponentTime;
